import React, { Component } from 'react';   
import Square from './square'
import './index.css';

class GameBoard extends Component {
    state = {  }
    render() {
        const status = 'Next player: X';
        return (
        <React.Fragment>
            <div className="status">{status}</div>
            <div className = "board-row">
                <Square value ='1'/>
                <Square value ='2'/>
                <Square value ='3'/>
            </div> 
            <div className = "board-row">
                <Square value ='4'/>
                <Square value ='5'/>
                <Square value ='6'/>
            </div> 
            <div className = "board-row">
                <Square value ='7'/>
                <Square value ='8'/>
                <Square value ='9'/>
            </div> 
        </React.Fragment>

    );
    }
}

export default GameBoard;
